__label__NewYork,NewYork ❤on valentine's day❤ we’ve decided to announce a very unique competition for everyone who has ever been in love! the winner will join us on a trip to the most romantic place on earth! trip is for two!! the rules are quite simple: 
1.	repost this photo with #followmeto14 hashtag;
2.	under the hashtag tell us the most romantic story of your life;
3.	tag 3 friends in comments below; 
4.	make sure you follow our youtube channel followmetoproject (link in bio) and @muradosmann account on instagram 
nataly and i will personally choose the winner! the competition will be closed on the 24th of february, so make your entry now! and good luck!:) ............................. 🇷🇺❤сегодня, в день святого валентина мы запускаем уникальный конкурс для всех, кто хоть раз в жизни был влюблён! победитель отправится с нами в одно из самых романтичных мест на земле! поездка разыгрывается на двоих!
условия конкурса очень просты: 
сделайте репост этой фотографии с хэштегом #followmeto14;
в подписи расскажите самую романтичную историю из вашей жизни;
отметьте 3-х друзей в комментариях под этой фотографией;
 убедитесь, что вы подписаны на канал followmetoproject на youtube (ссылка в профиле) и аккаунт @muradosmann в instagram
победителя мы с наташей выберем лично! конкурс продлится до 24 февраля, так что торопитесь! и удачи всем!;)❤🇷🇺

