__label__Norway i’ve photographed more days with blue skies than i can count. honestly they all start to blend together. but some of these sessions in the arctic have been permanently seared into my mind. you give so much more of yourself to explore & ride waves like this when it’s hovering below 0 degrees. maybe the sacrifice is what makes it so worthwhile. just to see what you are willing to give for a once in a lifetime experience.
.

@brettbarley

