__label__Helsinki happy tuesday, fellow dreamers! what are your goals and aspirations for the week?
⠀⠀⠀ ⠀
mine are: wrap up my outline for my life design course (!!!), pick a cover photo for my upcoming book, and finish a forbes article draft 🤩.
⠀⠀⠀ ⠀
i’m also finishing up @myhelsinki series, and wanted to share some recommendations 🙏🏼 .

accommodation:⠀⠀⠀ ⠀
the city is full of quirky spots like @hotelkatajanokka, a gorgeous hotel which used to be a prison. they hosted me and @julesjetsets during our last few days and it was amazing, not to mention their restaurant had incredible food 😍.
⠀⠀⠀ ⠀
these were my absolute favorite restaurants (we ate like queens in helsinki btw):
@hotelkatajanokka restaurant
@restaurantnolla
@juuri_restaurant
@restaurantolo 
@levain_helsinki
@restaurantstory.fi
⠀⠀⠀ ⠀
fave places i visited:
@kiasmagram (modern design museum)
@loylyhelsinki (sauna + food!)
huvilakatu (really pretty street)
@mariazeroone (startup community house in a building that used to be a hospital!)
⠀⠀⠀ ⠀
make sure to go to these places when you visit helsinki, you won’t regret it!
⠀⠀⠀ ⠀
