__label__Athens,Greece graffiti, although vandalism, is still a form of art and self-expression. and once you get past the initial shock of 90% of athens looking like this, you'll come to see the beauty in all of it.

graffiti once used to be caricatures of penises, so it's quite lovely to see its much advanced evolution 😂

